window.bookSummaryJSON = "<p>What if we sent freighters instead of frigates? </p> <p>In a universe run by corporations, where profit matters more than life, how can an orphan with no skills, no money, and no prospects survive? </p> <p>When Ishmael Wang's mother dies in a senseless accident, he's given a choice: leave the planet on his own, or the company will remove him. To avoid deportation Ishmael finds work as a mess deck attendant on an interstellar freighter. </p> <p>Find out what Ishmael must do to earn his Quarter Share. </p>"; 
